import Footer from "../Footer/Footer";
import Header from "../Header/Header";

const Home = () =>
{
    const TravelToSchedule = () =>
    {
        window.location.href = "http://localhost:3000/schedule"
    }
    
    
    const TravelToHelp = () =>
    {
        window.location.href = "http://localhost:3000/help"
    }
    return (
        <div>
            <Header />
           
            
            
            <button onClick={TravelToHelp}>Помощь</button>
            <Footer />
        </div>
    )
}

export default Home;
